CREATE OR REPLACE PROCEDURE PROCESS_DIM_DATE() LANGUAGE PLPGSQL AS $$
BEGIN IF NOT tableexists('DIM_DATE') THEN CREATE TABLE DIM_DATE AS WITH t1 AS( SELECT fecha_actualizacion::DATE AS fecha FROM raw_licitaciones_step_2 rls UNION ALL SELECT CASE WHEN fecha_presentacion_oferta='' THEN NULL::DATE ELSE fecha_presentacion_oferta::DATE END fecha FROM raw_licitaciones_step_2 rls2 UNION ALL SELECT CASE WHEN fecha_formalizacion='' THEN NULL::DATE ELSE fecha_formalizacion::DATE END fecha FROM raw_resultados_step_2 rrs UNION ALL SELECT CASE WHEN fecha_entrada_vigor='' THEN NULL::DATE ELSE fecha_entrada_vigor::DATE END fecha FROM raw_resultados_step_2 rrs UNION ALL SELECT CASE WHEN fecha_acuerdo='' THEN NULL::DATE ELSE fecha_acuerdo::DATE END fecha FROM raw_resultados_step_2 rrs ), t2 AS( SELECT * FROM t1 WHERE fecha IS NOT null GROUP BY 1 )
SELECT to_char(fecha, 'YYYYMMDD')::integer id, fecha, EXTRACT(YEAR FROM fecha) "ao", EXTRACT(MONTH FROM fecha) "mes", EXTRACT(QUARTER FROM fecha) "trimestre", EXTRACT(DAY FROM fecha) "dia_mes", EXTRACT(WEEK FROM fecha) "semana_ao", EXTRACT(ISODOW FROM fecha) "dia_semana" FROM t2; ALTER TABLE DIM_DATE ADD PRIMARY KEY (id); ELSE WITH t1 AS( SELECT fecha_actualizacion::DATE AS fecha FROM raw_licitaciones_step_2 rls UNION ALL SELECT CASE WHEN fecha_presentacion_oferta='' THEN NULL::DATE ELSE fecha_presentacion_oferta::DATE END fecha FROM raw_licitaciones_step_2 rls2 UNION ALL SELECT CASE WHEN fecha_formalizacion='' THEN NULL::DATE ELSE fecha_formalizacion::DATE END fecha FROM raw_resultados_step_2 rrs UNION ALL SELECT CASE WHEN fecha_entrada_vigor='' THEN NULL::DATE ELSE fecha_entrada_vigor::DATE END fecha FROM raw_resultados_step_2 rrs UNION ALL SELECT CASE WHEN fecha_acuerdo='' THEN NULL::DATE ELSE fecha_acuerdo::DATE END fecha FROM raw_resultados_step_2 rrs ), t2 AS( SELECT * FROM t1 WHERE fecha IS NOT null GROUP BY 1 ), t3 AS( SELECT to_char(fecha, 'YYYYMMDD')::integer id, fecha, EXTRACT(YEAR FROM fecha) "ao", EXTRACT(MONTH FROM fecha) "mes", EXTRACT(QUARTER FROM fecha) "trimestre", EXTRACT(DAY FROM fecha) "dia_mes", EXTRACT(WEEK FROM fecha) "semana_ao", EXTRACT(ISODOW FROM fecha) "dia_semana" FROM t2 ) INSERT INTO DIM_DATE SELECT * FROM t3 WHERE id NOT IN (SELECT id FROM DIM_DATE) ; END IF; END;$$;

CREATE OR REPLACE PROCEDURE DELETE_ALL_RAW_TABLES()
LANGUAGE PLPGSQL 
AS $$
BEGIN
  DROP TABLE raw_cpv_lics;	
  DROP TABLE raw_cpv_res;
  DROP TABLE raw_deleted_entries;
  DROP TABLE raw_licitaciones;
  DROP TABLE raw_licitaciones_step_2;
  DROP TABLE raw_resultados_lotes;
  DROP TABLE raw_resultados_step_2;
END;$$;

CREATE OR REPLACE PROCEDURE PROCESS_BRIDGE_CPV_LICITACIONES() LANGUAGE PLPGSQL AS $$
BEGIN IF NOT tableexists('BRIDGE_CPV_LICITACIONES') THEN CREATE TABLE BRIDGE_CPV_LICITACIONES AS WITH t1 AS( SELECT ddl.id id_licitacion, dc.id id_cpv FROM raw_cpv_lics rcl INNER JOIN dim_cpv dc ON dc.cod=rcl.cod INNER JOIN dim_detalle_licitaciones ddl ON ddl.id_licitacion=rcl.id_lic AND ddl."current"=TRUE AND ddl.date_from=rcl.fecha_actualizacion::TIMESTAMP WITH TIME ZONE ) SELECT * FROM t1; ALTER TABLE BRIDGE_CPV_LICITACIONES ADD CONSTRAINT fk_dim_detalle_licitaciones_bridge_cpv_licitaciones FOREIGN KEY (id_licitacion) REFERENCES dim_detalle_licitaciones(id); ALTER TABLE BRIDGE_CPV_LICITACIONES ADD CONSTRAINT fk_dim_cpv_bridge_cpv_licitaciones FOREIGN KEY (id_cpv) REFERENCES dim_cpv(id); ELSE WITH t1 AS( SELECT
FROM raw_cpv_lics rcl INNER JOIN dim_cpv dc ON dc.cod=rcl.cod INNER JOIN dim_detalle_licitaciones ddl ON ddl.id_licitacion=rcl.id_lic AND ddl."current"=TRUE AND ddl.date_from=rcl.fecha_actualizacion::TIMESTAMP WITH TIME ZONE ) INSERT INTO BRIDGE_CPV_LICITACIONES SELECT * FROM t1; END IF; END;$$;

CREATE OR REPLACE PROCEDURE PROCESS_FACT_LICITACIONES() LANGUAGE PLPGSQL AS $$
BEGIN IF NOT tableexists('FACT_LICITACIONES') THEN CREATE TABLE FACT_LICITACIONES AS WITH t1 AS( SELECT id id_licitacion, nif_oc, fecha_actualizacion::TIMESTAMP WITH TIME ZONE timestamp_actualizacion, to_char(fecha_actualizacion::TIMESTAMP WITH TIME ZONE, 'YYYYMMDD')::integer id_actualizacion, CASE WHEN fecha_presentacion_oferta='' THEN NULL::INTEGER ELSE to_char(fecha_presentacion_oferta::TIMESTAMP WITH TIME ZONE, 'YYYYMMDD')::integer END id_fecha_presentacion_oferta, valor_estimado_contrato::FLOAT, presupuesto_base::FLOAT, presupuesto_con_impuestos::FLOAT, ROUND(porcentaje_subcontratacion::NUMERIC/100 ,2) porcentaje_subcontratacion FROM raw_licitaciones_step_2 rls ), t2 AS( SELECT ddl.id id_licitacion, doc.id id_organo_contratacion, t1.id_actualizacion, t1.id_fecha_presentacion_oferta, t1.valor_estimado_contrato, t1.presupuesto_base, t1.presupuesto_con_impuestos, t1.porcentaje_subcontratacion FROM t1 INNER JOIN dim_detalle_licitaciones ddl ON t1.id_licitacion= ddl.id_licitacion AND ddl."current" = TRUE AND ddl.date_from= t1.timestamp_actualizacion INNER JOIN dim_organos_contratacion doc ON t1.nif_oc=doc.nif_oc
) SELECT * FROM t2; ALTER TABLE FACT_LICITACIONES ADD CONSTRAINT fk_dim_detalle_licitaciones_fact_licitaciones FOREIGN KEY (id_licitacion) REFERENCES dim_detalle_licitaciones (id); ALTER TABLE FACT_LICITACIONES ADD CONSTRAINT fk_dim_organos_contratacion_fact_licitaciones FOREIGN KEY (id_organo_contratacion) REFERENCES dim_organos_contratacion(id); ALTER TABLE FACT_LICITACIONES ADD CONSTRAINT fk_dim_date_fact_licitaciones FOREIGN KEY (id_actualizacion) REFERENCES dim_date(id); ALTER TABLE FACT_LICITACIONES ADD CONSTRAINT fk_id_fecha_presentacion_oferta_fact_licitaciones FOREIGN KEY (id_fecha_presentacion_oferta) REFERENCES dim_date(id); ELSE WITH t1 AS( SELECT id id_licitacion, nif_oc, fecha_actualizacion::TIMESTAMP WITH TIME ZONE timestamp_actualizacion, to_char(fecha_actualizacion::TIMESTAMP WITH TIME ZONE, 'YYYYMMDD')::integer id_actualizacion, CASE WHEN fecha_presentacion_oferta='' THEN NULL::INTEGER ELSE to_char(fecha_presentacion_oferta::TIMESTAMP WITH TIME ZONE, 'YYYYMMDD')::integer END id_fecha_presentacion_oferta, valor_estimado_contrato::FLOAT, presupuesto_base::FLOAT, presupuesto_con_impuestos::FLOAT, ROUND(porcentaje_subcontratacion::NUMERIC/100 ,2) porcentaje_subcontratacion FROM raw_licitaciones_step_2 rls ), t2 AS( SELECT ddl.id id_licitacion, doc.id id_organo_contratacion, t1.id_actualizacion, t1.id_fecha_presentacion_oferta, t1.valor_estimado_contrato, t1.presupuesto_base, t1.presupuesto_con_impuestos, t1.porcentaje_subcontratacion FROM t1 INNER JOIN dim_detalle_licitaciones ddl ON t1.id_licitacion= ddl.id_licitacion AND ddl."current" = TRUE AND ddl.date_from= t1.timestamp_actualizacion INNER JOIN dim_organos_contratacion doc ON t1.nif_oc=doc.nif_oc
) INSERT INTO FACT_LICITACIONES SELECT * FROM T2; END IF; END;$$;

CREATE OR REPLACE PROCEDURE PROCESS_DIM_DETALLE_LICITACIONES() LANGUAGE PLPGSQL AS $$ DECLARE max_id INTEGER := 0; BEGIN IF NOT tableexists('DIM_DETALLE_LICITACIONES') THEN CREATE TABLE DIM_DETALLE_LICITACIONES AS WITH t1 AS( SELECT ROW_NUMBER() OVER(PARTITION BY id ORDER BY fecha_actualizacion::TIMESTAMP WITH TIME ZONE DESC) rk, id id_licitacion, link, situacion, fecha_actualizacion, numero_expediente, estado, tipo_administracion, dir3, nif_oc, organo_contratacion , codigo_postal , objeto, tipo_contrato, lugar_ejecucion, tipo_procedimiento , tramitacion , sistema_contratacion, directiva_aplicacion , subcontratacion , funding, funding_program FROM raw_licitaciones_step_2) SELECT ROW_NUMBER() OVER(ORDER BY fecha_actualizacion) id, id_licitacion, link, situacion, fecha_actualizacion::TIMESTAMP WITH TIME ZONE date_from, NULL::TIMESTAMP date_to, TRUE "current", numero_expediente, estado, tipo_administracion, dir3, nif_oc, organo_contratacion , codigo_postal , objeto, tipo_contrato, lugar_ejecucion, tipo_procedimiento , tramitacion , sistema_contratacion, directiva_aplicacion , subcontratacion , funding, funding_program FROM t1 WHERE rk=1; ALTER TABLE dim_detalle_licitaciones ADD PRIMARY KEY (id); ELSE max_id := (SELECT MAX(id) FROM dim_detalle_licitaciones); WITH t1 AS( SELECT ROW_NUMBER() OVER(PARTITION BY id ORDER BY fecha_actualizacion DESC) rk, id id_licitacion, link, situacion, fecha_actualizacion, numero_expediente, estado, tipo_administracion, dir3, nif_oc, organo_contratacion , codigo_postal , objeto, tipo_contrato, lugar_ejecucion, tipo_procedimiento , tramitacion , sistema_contratacion, directiva_aplicacion , subcontratacion , funding, funding_program FROM raw_licitaciones_step_2), t2 AS( SELECT ROW_NUMBER() OVER(ORDER BY fecha_actualizacion) + max_id id, id_licitacion, link, situacion, fecha_actualizacion::TIMESTAMP WITH TIME ZONE date_from, NULL::TIMESTAMP date_to, TRUE "current", numero_expediente, estado, tipo_administracion, dir3, nif_oc, organo_contratacion , codigo_postal , objeto, tipo_contrato, lugar_ejecucion, tipo_procedimiento , tramitacion , sistema_contratacion, directiva_aplicacion , subcontratacion , funding, funding_program FROM t1 WHERE rk=1 ), to_be_upserted AS( SELECT t2.* FROM t2 INNER JOIN dim_detalle_licitaciones ON dim_detalle_licitaciones.id_licitacion=t2.id_licitacion AND dim_detalle_licitaciones.date_from<t2.date_from AND dim_detalle_licitaciones."current"=TRUE ), to_be_inserted AS( SELECT t2.* FROM t2 WHERE id_licitacion NOT IN (SELECT id_licitacion FROM dim_detalle_licitaciones) ), updated AS( UPDATE dim_detalle_licitaciones SET date_to=to_be_upserted.date_from, "current"=FALSE FROM to_be_upserted WHERE dim_detalle_licitaciones.id_licitacion=to_be_upserted.id_licitacion AND dim_detalle_licitaciones.date_from<to_be_upserted.date_from AND dim_detalle_licitaciones."current"=TRUE ), upsert AS( INSERT INTO dim_detalle_licitaciones SELECT * FROM to_be_upserted ) INSERT INTO dim_detalle_licitaciones SELECT * FROM to_be_inserted;
END IF;
max_id := (SELECT MAX(id) FROM dim_detalle_licitaciones); WITH to_be_upserted AS( SELECT ROW_NUMBER() OVER(ORDER BY date_from) + max_id id, "ref" id_licitacion, link, CASE WHEN EXTRACT( YEAR FROM dim_detalle_licitaciones.date_from::TIMESTAMP - raw_deleted_entries."deletedat"::TIMESTAMP WITH TIME ZONE )>=5 THEN 'ARCHIVADA' ELSE 'ANULADA' END AS situacion, "deletedat"::TIMESTAMP WITH TIME ZONE date_from, NULL::TIMESTAMP date_to, TRUE "current", numero_expediente, estado, tipo_administracion, dir3, nif_oc, organo_contratacion , codigo_postal , objeto, tipo_contrato, lugar_ejecucion, tipo_procedimiento , tramitacion , sistema_contratacion, directiva_aplicacion , subcontratacion , funding, funding_program FROM raw_deleted_entries INNER JOIN dim_detalle_licitaciones ON dim_detalle_licitaciones.id_licitacion= raw_deleted_entries."ref" AND dim_detalle_licitaciones."current"=TRUE AND dim_detalle_licitaciones.situacion='VIGENTE' ), updated AS( UPDATE dim_detalle_licitaciones SET date_to=to_be_upserted.date_from, "current"=FALSE FROM to_be_upserted WHERE dim_detalle_licitaciones.id_licitacion=to_be_upserted.id_licitacion AND dim_detalle_licitaciones."current"=TRUE AND dim_detalle_licitaciones.situacion='VIGENTE' ) INSERT INTO dim_detalle_licitaciones SELECT * FROM to_be_upserted; END;$$;
